  };

  return (
    <div>
      <h1>Organisations</h1>
      <button onClick={handleCreate}>Create New Organisation</button>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {organisations.map(org => (
            <tr key={org.id}>
              <td>{org.name}</td>
              <td>
                <button onClick={() => handleEdit(org.id)}>Edit</button>
                <button onClick={() => handleDelete(org.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default OrganisationsPage;
